INSERT INTO events VALUES('70cc1fec-e109-4b9a-bb01-971cf841563a','ottawa_public_health_agent','user','compaction_demo','e-fdc5a8b7-6b88-4f6f-9994-5b0091c80ea2','ottawa_public_health_agent',X'',NULL,NULL,'2025-11-30 02:02:46.602626','{"parts": [{"function_response": {"id": "adk-4e9d38ff-c881-4916-9a73-1b28ce60afbb", "name": "ResearchAgent", "response": {"result": "Here are some of the latest news and developments regarding Artificial Intelligence in healthcare:\n\n*   The global AI in healthcare market, valued at approximately USD 26.6 billion in 2024, is projected to reach nearly USD 187 billion by 2030, growing at a compound annual growth rate (CAGR) of approximately 38.5%. This growth is attributed to the increasing burden of chronic diseases and the exponential growth of healthcare data. Key areas of adoption include diagnostics, imaging, genomics, and personalized medicine, with increased use of AI for operational efficiency and workflow automation, supported by strong public and private investments globally.\n*   Google I/O 2025 showcased next-generation healthcare AI tools, including GenAI models for imaging interpretation, clinical documentation, and medical copilots for physicians. Google also introduced Gemini-based models for radiology and workflow automation, demonstrated AI assistants that support doctors in real-time decision-making, and highlighted AI-powered documentation tools that integrate with Electronic Health Records (EHRs), aiming to reduce burnout and improve care quality.\n*   Researchers at the University of North Carolina have launched an AI-powered chatbot designed to provide accurate and confidential reproductive health information. This tool helps users with topics such as contraception, pregnancy, and sexual health by offering medically reviewed answers to sensitive questions, aiming to improve access to reliable resources, particularly in areas with restricted reproductive health services, while ensuring user privacy.\n*   NextGen Healthcare launched the NextGen Navigator AI Agent.\n*   Valley Children''s Hospital is utilizing AI to enhance pediatric care.\n*   A new AI tool in Melbourne enables rapid skin cancer diagnosis.\n*   AIIMS Patna has integrated AI-powered devices to enhance patient care.\n*   New AI tests are helping identify prostate cancer patients who would benefit from Abiraterone.\n*   AI-powered hearing aids are helping connect individuals with hearing loss to the hearing world.\n*   ElliQ is an AI care companion that supports aging-in-place for seniors.\n*   Artificial intelligence technology is increasingly important in healthcare, with applications proliferating across health systems, private practices, and research labs for clinical, research, and administrative tasks, potentially freeing up physician time.\n*   The American Medical Association (AMA) is actively involved in discussions regarding the appropriate level of AI and healthcare intersection, particularly concerning diagnosis and treatment decisions. The AMA adopted a policy in November 2025 to advance AI literacy in medical education and will work to provide medical students and physicians with the necessary health AI training.\n*   Patients and doctors are beginning to use AI tools to challenge insurance denials, prior authorizations, and high medical bills, creating a \"robotic tug-of-war\" against health insurers who use AI to automate claims processing. Several businesses and nonprofits have launched AI-powered tools to help patients get insurance claims paid and navigate complex medical bills.\n*   In November 2025, NBC News reported on AI being implemented in various healthcare settings to help doctors spot sepsis and perform neurological research. Doctors at the Cleveland Clinic are using AI to identify sepsis faster, and the clinic is also testing the world''s first neurological AI model trained on electrical brain waves to detect seizures. A spine surgeon at Duke Health is using AI that provides a 3D view of the patient''s spine in real-time during surgery, aiming to shorten complicated procedures.\n*   Qure.ai secured $65 million in Series D funding, launched an FDA-cleared AI solution for advanced lung nodule quantification, and received its 12th patent in India for lung abnormality detection. Studies by Qure.ai indicate that AI helps doctors treat stroke faster and plays a significant role in the early detection of lung cancer, even in younger, non-smoking individuals. The company has also partnered with Johnson & Johnson Medtech and Microsoft to boost early detection of lung cancer."}}}], "role": "user"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
INSERT INTO events VALUES('42678440-96a4-43ea-a5b2-b0a52c03ca26','ottawa_public_health_agent','user','compaction_demo','e-fdc5a8b7-6b88-4f6f-9994-5b0091c80ea2','ottawa_public_health_agent',X'',NULL,NULL,'2025-11-30 02:02:46.611774','{"parts": [{"text": "The field of AI in healthcare is rapidly expanding! The market is projected to grow significantly, reaching nearly USD 187 billion by 2030, driven by the increasing burden of chronic diseases and vast healthcare data.\n\nHere are some recent highlights:\n\n*   **Google''s innovations:** Google I/O 2025 showcased next-gen AI tools for imaging interpretation, clinical documentation, and medical copilots, aiming to reduce physician burnout and improve care quality.\n*   **Reproductive health chatbot:** Researchers at the University of North Carolina launched an AI-powered chatbot for accurate and confidential reproductive health information.\n*   **New AI tools and partnerships:** NextGen Healthcare launched the NextGen Navigator AI Agent, and companies like Qure.ai are securing significant funding and developing solutions for early detection of lung cancer and faster stroke treatment.\n*   **AI in hospitals:** Valley Children''s Hospital is using AI for pediatric care, AIIMS Patna has integrated AI devices, and a new AI tool in Melbourne facilitates rapid skin cancer diagnosis.\n*   **Enhancing patient care:** AI is being used in hearing aids to connect individuals with hearing loss, and ElliQ is an AI care companion supporting seniors aging-in-place.\n*   **Challenging insurance denials:** Patients and doctors are using AI tools to challenge insurance denials and high medical bills.\n*   **AMA''s involvement:** The American Medical Association (AMA) adopted a policy in November 2025 to advance AI literacy in medical education.\n*   **Real-time applications:** AI is being implemented in various healthcare settings to help doctors spot sepsis faster, perform neurological research, and provide 3D views of a patient''s spine during surgery."}], "role": "model"}',NULL,NULL,'{"candidates_token_count": 358, "prompt_token_count": 1801, "prompt_tokens_details": [{"modality": "TEXT", "token_count": 1801}], "total_token_count": 2159}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
