INSERT INTO events VALUES('5c51ade0-5ac0-47ae-b1fb-c2791d275439','ottawa_public_health_agent','user','compaction_demo','e-9cafba55-9eaf-47ca-a636-00864682adc5','ottawa_public_health_agent',X'',NULL,NULL,'2025-11-30 02:03:58.198892','{"parts": [{"function_response": {"id": "adk-82d7d1b2-faa7-4331-a83b-0f9e1a6fafb6", "name": "ResearchAgent", "response": {"result": "Key Findings on Latest AI in Healthcare News:\n\n*   A new AI machine learning model by AstraZeneca can detect early signs of over 1,000 diseases, predicting diagnoses years in advance using medical data from 500,000 people in a UK health data repository.\n*   New AI software for interpreting brain scans of stroke patients is \"twice as accurate\" as professionals and can identify the timeframe of the stroke.\n*   Microsoft has introduced Dragon Copilot, an AI healthcare tool that listens to and creates notes on clinical consultations. Google also has AI models to reduce administrative burdens in healthcare.\n*   The global AI in healthcare market, valued at approximately USD 26.6 billion in 2024, is projected to reach nearly USD 187 billion by 2030, driven by the increasing burden of chronic diseases and the explosion of healthcare data.\n*   Key adoption areas for AI in healthcare include diagnostics, imaging, genomics, and personalized medicine, with increased use for operational efficiency and workflow automation, supported by strong public and private investments.\n*   Google I/O 2025 showcased next-gen healthcare AI tools, including GenAI models for imaging interpretation, clinical documentation, and medical copilots for physicians.\n*   Researchers introduced Delphi-2M, an AI model that can predict long-term disease trajectories across more than 1,000 conditions, using large-scale datasets such as UK Biobank and Danish health registries.\n*   Global Healthcare Exchange (GHX) launched AI capabilities to enhance supply chain efficiency in healthcare, predicting supply needs and minimizing shortages.\n*   AI is being used to scan radiology images for early detection of cancers and heart disease, predict outcomes using electronic health records, and improve clinical trial design.\n*   AI streamlines administrative tasks like scheduling appointments and processing insurance claims, reducing burdens and improving operational efficiency.\n*   AI decision-making tools are expected to become mainstream in 2025, offering doctors immediate access to evidence-based research and treatment guidelines.\n*   Generative AI (GenAI) applications are anticipated to accelerate diagnoses, minimize diagnostic errors, and speed up patient care while more accurately predicting patient outcomes.\n*   Digital tools such as smart implants and wearable tech will provide real-time patient data, which, combined with genomics and lifestyle information, will enable precision diagnoses and treatment, often at home.\n*   In 2025, 22% of healthcare organizations have implemented domain-specific AI tools, a 7x increase over 2024. Health systems lead adoption at 27%, followed by outpatient providers at 18% and payers at 14%.\n*   Ambient scribes have become a breakout category in healthcare AI, generating $600 million in 2025, with Abridge (30% market share), Ambience (13%), and Nuance''s DAX Copilot (33%) being leading solutions.\n*   Procurement cycles for health systems have shortened by 18% (from 8.0 to 6.6 months) for AI purchases, and for outpatient providers by 22% (from 6.0 to 4.7 months).\n*   Patients and doctors are using AI tools to contest insurance claims denials and prior authorizations.\n*   The American Medical Association (AMA) is working to boost health AI training across the medical education continuum and adopted a policy to advance AI literacy in medical education in November 2025.\n*   AI is being implemented in healthcare settings to help doctors spot sepsis and perform neurological research. The Cleveland Clinic uses AI to monitor patient data for early signs of sepsis and is testing the world''s first neurological AI model trained on electrical brain waves for seizure detection.\n*   Proprio, an FDA-approved AI tool, provides spine surgeons with a 3D view of the patient''s spine in real-time, potentially shortening complex surgeries.\n*   Qure.ai secured $65 million in Series D funding and has launched FDA-cleared AI solutions for lung nodule quantification and chest X-ray analysis for pneumothorax, and is working to accelerate early detection of lung cancer and TB."}}}], "role": "user"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
