INSERT INTO events VALUES('5fc12254-a36a-4b8e-a254-a52f97911b23','ottawa_public_health_agent','user','compaction_demo','e-753beb14-a60c-401a-b93b-dc8f15adde36','ottawa_public_health_agent',X'',NULL,NULL,'2025-11-30 02:05:50.467405','{"parts": [{"function_response": {"id": "adk-76a21302-fd86-4a56-8d0c-8ce7b2fe4283", "name": "ResearchAgent", "response": {"result": "Here are some of the main companies involved in organoids and organ-on-a-chip technologies:\n\n**Companies in Organ-on-a-Chip Technologies:**\n\n*   **Emulate, Inc.** is a pioneer in the organs-on-chips market, offering platforms that replicate physiological responses for drug efficacy and toxicity studies. Its Human Emulation System integrates hardware, software, and organ-chip technology.\n*   **MIMETAS B.V.** is known for its OrganoPlate\u00ae platform, which enables the growth of 3D human tissues with controlled perfusion for high-throughput drug screening, toxicity assessment, and disease modeling.\n*   **TissUse GmbH** has developed Multi-Organ-Chip technology, integrating multiple miniaturized human organs on a single platform to understand systemic drug effects.\n*   **CN Bio Innovations Ltd.** focuses on liver-focused and multi-organ microphysiological systems for predicting metabolic behavior and toxicity in drug development.\n*   **InSphero** combines organ-on-a-chip technology with its 3D spheroid and organoid models, with products like liver-on-a-chip and pancreatic islet models for metabolic diseases and drug-induced liver injuries.\n*   **Nortis** develops in vitro organ-on-a-chip models that replicate human vascular systems, including kidney-on-a-chip and vascular-on-a-chip for renal toxicity and cardiovascular research.\n*   **BioIVT** offers the OrganDOT platform, integrating primary cell cultures into organ-on-a-chip technology for pancreatic islet-on-a-chip and lung airway epithelium models.\n*   **Hesperos Inc.** is noted for its fully interconnected, multi-organ systems and Human-on-a-Chip\u00ae platform, which links multiple tissues to model whole-body responses.\n*   **AxoSim** specializes in neural tissue and nerve-on-chip models for neurotoxicity assessment and peripheral nerve disease modeling.\n*   **4Dcell** develops lung-on-a-chip and kidney-on-a-chip models for toxicology and disease progression studies.\n*   **AlveoliX** develops lung-on-a-chip models to simulate pulmonary biomechanics for conditions like asthma, COPD, and pulmonary fibrosis.\n*   **Elveflow** specializes in high-precision microfluidic systems crucial for dynamic tissue culture environments in organ-on-a-chip applications.\n*   **BiomimX** utilizes its uBeat\u2122 platform to mimic contractile tissues for cardiovascular and musculoskeletal drug development.\n*   **Tissue Dynamics** is an AI-driven organ-on-a-chip company focusing on metabolic disease research with diabetes-on-a-chip and kidney-on-a-chip models.\n*   **Valo Health** integrates organ-on-a-chip technology with AI for drug discovery, particularly with a heart-on-a-chip platform for cardiac disease research.\n*   **Cherry Biotech** develops CubiX, a tumor-on-a-chip platform for personalized oncology research.\n*   **H\u00b5rel Corporation** (also referred to as Hurel Corporation) has pioneering work in liver-based organ chips, focusing on predictive ADME and toxicity studies.\n*   **Kirkstall Ltd.** specializes in flow-based cell culture systems, like the Quasi-Vivo\u00ae platform, for studying organ interactions.\n*   **VitrofluidiX** develops an organ-on-a-chip device that stimulates any organ by controlling parameters in customizable single- or multi-organ chip formats.\n*   **Anivance AI** builds an AI-driven organ-on-a-chip platform that uses large language models to automate experimental workflows.\n*   **OrganoBiotech** develops organ-on-a-chip models to enhance preclinical drug testing relevance by combining microfluidic systems with modular design.\n*   **Humanase** develops a brain-on-a-chip platform using human iPSC-derived neuronal cells and astrocytes for evaluating drug efficacy and toxicity.\n\n**Companies involved in Organoids (some also overlap with organ-on-a-chip):**\n\n*   **Thermo Fisher Scientific Inc.** is a leading player in the human organoids market.\n*   **Corning Incorporated** is also a leading player in the human organoids market.\n*   **Merck KGaA** (also listed as Merck) is a key company in the organoids market.\n*   **STEMCELL Technologies** is listed among the top organoid companies.\n*   **Lonza Group** is involved in the organoids market.\n*   **Greiner Bio One International** is an organoids company.\n*   **Cellesce** is listed among top organoids companies.\n*   **Hubrecht Organoid Technology (HUB Organoids BV)** is a significant entity in the organoid field.\n*   **ATCC** is an organoids company.\n*   **Sartorius** is listed among organoids companies.\n*   **Eppendorf** is an organoids company.\n*   **Miltenyi Biotec B.V. & Co. KG.** is also involved in organoids.\n*   **BICO Group AB** (also listed as BICO) is an organoids company.\n*   **QGel SA** is an organoids company.\n*   **Advanced BioMatrix Inc.** is listed among organoids companies.\n*   **3Dnamics** is a top organoids company.\n*   **R&D Systems** is listed among top organoids companies.\n*   **Newcells Biotech** develops induced pluripotent stem cells (iPSC)-derived organoid models.\n*   **Ncardia** is listed as an organoid research model startup.\n*   **bit.bio** is listed as an organoid research model startup.\n*   **NEXEL** provides iPSC-derived cells and organoids, including cardiac and heart organoids.\n*   **Vivodyne** is listed as an organoid research model startup.\n*   **Parallel Bio** is listed as an organoid research model startup.\n*   **FluidForm Bio** is listed as an organoid research model startup.\n*   **Pandorum Technologies Pvt. Ltd** develops regenerative medicine and 3D tissues, including 3D hepatocyte spheroids."}}}], "role": "user"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
INSERT INTO events VALUES('d53050d6-255f-43de-a221-d26bfc9b4b28','ottawa_public_health_agent','user','compaction_demo','e-753beb14-a60c-401a-b93b-dc8f15adde36','ottawa_public_health_agent',X'',NULL,NULL,'2025-11-30 02:05:50.475949','{"parts": [{"text": "Numerous companies are actively involved in the development and application of organoids and organ-on-a-chip technologies:\n\n**In Organ-on-a-Chip Technologies, some key players include:**\n\n*   **Emulate, Inc.** (pioneer with Human Emulation System)\n*   **MIMETAS B.V.** (OrganoPlate\u00ae platform)\n*   **TissUse GmbH** (Multi-Organ-Chip technology)\n*   **CN Bio Innovations Ltd.** (liver-focused and multi-organ systems)\n*   **InSphero** (combines with 3D spheroid and organoid models)\n*   **Hesperos Inc.** (fully interconnected, multi-organ Human-on-a-Chip\u00ae platform)\n*   **Valo Health** (integrates with AI for drug discovery)\n*   **Cherry Biotech** (CubiX, a tumor-on-a-chip platform)\n\n**In Organoids (with some overlap with organ-on-a-chip), prominent companies include:**\n\n*   **Thermo Fisher Scientific Inc.** (leading player)\n*   **Corning Incorporated** (leading player)\n*   **Merck KGaA** (key company)\n*   **STEMCELL Technologies**\n*   **Lonza Group**\n*   **Hubrecht Organoid Technology (HUB Organoids BV)** (significant entity)\n*   **Newcells Biotech** (iPSC-derived organoid models)\n*   **NEXEL** (iPSC-derived cells and organoids, including cardiac and heart organoids)\n\nThis list is not exhaustive, as the field is rapidly evolving with many companies contributing to these innovative areas of drug discovery."}], "role": "model"}',NULL,NULL,'{"cache_tokens_details": [{"modality": "TEXT", "token_count": 2756}], "cached_content_token_count": 2756, "candidates_token_count": 362, "prompt_token_count": 5044, "prompt_tokens_details": [{"modality": "TEXT", "token_count": 5044}], "total_token_count": 5406}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
