INSERT INTO events VALUES('4d159c43-d1ae-4f8a-96fd-5322119c761e','ottawa_public_health_agent','user','compaction_demo','e-b485c65a-f588-458b-ac4e-4dbccfe3dcf4','ottawa_public_health_agent',X'','[]',NULL,'2025-11-30 02:06:23.805154','{"parts": [{"function_call": {"id": "adk-59085b2d-7d00-457b-bcbf-338dc6646cf8", "args": {"request": "latest news about AI in healthcare"}, "name": "ResearchAgent"}, "thought_signature": "CtsCAXLI2nxod6Lxzs7RvnG14hnmQcpFG5ZdnW4eaoKRjf7cHzuPWPXlKFZzxFEzE7Uh8Beuq4PUsOEgRYWpb9jkKVdQDzWnGfM5nw235a_vIp-qdrnNAK50XTn03VGPS-F3vAtffQ59prjIGLejPtgGfREVS1PYVYyNUGO_aJvltCoKCe_kuZaY-tfSC_hD0hFyXVMcqgw3TcQtJG1aHI6S-ec7XEvtX32h78kmEhjCt0V7TApZc47KwV66xBaE5B0RyEwH8aB1X6dbx6X1VGZbGR4qNVQ7yWbeN6feO0AW2AnwbF0jirGtTvDNhOTgAQMOXljZtt81bNHNCytaBe_JuOm_ydxU-ctYvsUTtakcDGGFE4FWR31mhk3T4MmwMC5wh2vvSqD77SAhDEzLj7KkUSPPq1SB4pM-LyJTV-ZTXmzusrRji5cLndkqMBLPe-1cboNtH1GvWYZTOzg="}, {"function_call": {"id": "adk-00bf58af-14cf-446b-bf97-d147e322c29a", "args": {"request": "new developments in drug discovery"}, "name": "ResearchAgent"}}], "role": "model"}',NULL,NULL,'{"cache_tokens_details": [{"modality": "TEXT", "token_count": 1753}], "cached_content_token_count": 1753, "candidates_token_count": 37, "prompt_token_count": 2417, "prompt_tokens_details": [{"modality": "TEXT", "token_count": 2417}], "thoughts_token_count": 72, "total_token_count": 2526}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
INSERT INTO events VALUES('bae47bb7-7a28-4783-af65-bef0a0dc1f31','ottawa_public_health_agent','user','compaction_demo','e-b485c65a-f588-458b-ac4e-4dbccfe3dcf4','ottawa_public_health_agent',X'',NULL,NULL,'2025-11-30 02:06:35.621151','{"parts": [{"function_response": {"id": "adk-59085b2d-7d00-457b-bcbf-338dc6646cf8", "name": "ResearchAgent", "response": {"result": "Here are some of the latest developments and trends regarding AI in healthcare:\n\n**Innovations and Applications:**\n*   At Google I/O 2025, Google showcased next-gen healthcare AI tools, including GenAI models for imaging interpretation, clinical documentation, and medical copilots for physicians. They introduced Gemini-based models for radiology and workflow automation, demonstrating AI assistants that support doctors in real-time decision-making and highlighting AI-powered documentation tools that integrate with EHRs.\n*   Researchers at the University of North Carolina have launched an AI-powered chatbot designed to provide accurate, confidential reproductive health information, helping users navigate topics such as contraception, pregnancy, and sexual health.\n*   Pharmaceutical Global Capability Centers (GCCs) in India are leveraging AI to accelerate drug discovery and reduce R&D costs significantly, employing AI models to analyze genomics, proteomics, and clinical data.\n*   NextGen Healthcare has launched its NextGen Navigator AI Agent.\n*   Valley Children''s Hospital is using AI to enhance pediatric care.\n*   A new AI tool enables rapid skin cancer diagnosis in Melbourne.\n*   AIIMS Patna has integrated AI-powered devices to enhance patient care.\n*   New AI tests are helping identify prostate cancer patients who benefit from Abiraterone.\n*   AI-powered hearing aids are helping connect Mainers to the hearing world.\n*   ElliQ is an AI care companion that supports aging-in-place for seniors.\n*   AI is being used to scan radiology images for early detection of cancers and heart disease, predict outcomes using electronic health records, and improve clinical trial design.\n*   Natural Language Processing (NLP) is being used to improve patient care through better diagnosis accuracy, streamline clinical processes, and provide more personalized services by analyzing medical records and identifying relevant treatments.\n*   AI algorithms can analyze medical images, such as X-rays and MRIs, with greater accuracy and speed than human radiologists, often detecting diseases like cancer at earlier stages.\n*   AI is streamlining administrative tasks like scheduling appointments and processing insurance claims, reducing burdens on healthcare providers.\n*   Microsoft has announced its Dragon Copilot, an AI healthcare tool that can listen to and create notes on clinical consultations. Google also has a suite of AI models tailored to alleviate administrative burdens in healthcare.\n*   AstraZeneca has developed a new AI machine learning model that can detect early signs of over 1,000 diseases, predicting diagnoses many years later with high confidence using medical data from 500,000 people.\n*   A new AI software has been found to be twice as accurate as professionals at examining brain scans of stroke patients and can identify the timescale of the stroke.\n*   Digital patient platform Huma reduced readmission rates by 30% and time spent reviewing patients by up to 40%, alleviating healthcare provider workload.\n*   AI is being implemented in healthcare settings to help doctors spot sepsis and perform neurological research. The Cleveland Clinic uses AI to monitor patient data (heart rate, temperature, oxygen levels) to identify new infections or sepsis faster.\n*   At Duke Health, a spine surgeon uses AI to get a 3D view of a patient''s spine in real-time during surgery, which can shorten complicated procedures.\n*   The Cleveland Clinic is testing the world''s first neurological AI model trained on electrical brain waves to detect seizures.\n*   Qure.ai has secured $65 million in Series D funding to transform global healthcare AI.\n*   Qure.ai launched an FDA-cleared AI solution for advanced lung nodule quantification and secured its 12th patent in India for advanced lung abnormality detection.\n*   Qure.ai''s AI-powered X-ray solution is being used for TB screening in Nepal and supporting public health efforts at Maha Kumbh Mela.\n*   Government of Goa has expanded AI-powered lung cancer screening with Qure.ai and AstraZeneca.\n*   Johnson & Johnson Medtech has partnered with Qure.ai to boost early detection of lung cancer.\n*   AI-enabled risk assessment for lung cancer has reached 5 million individuals.\n*   Yashoda Hospital Hitech City and Qure.ai have launched an AI-Enabled Lung Nodule Clinic.\n*   Qure.ai is partnering with Microsoft to increase access to its lung cancer detection solutions.\n*   Early findings from an AI study at Frimley Health NHS Foundation Trust show 99.7% accuracy.\n*   Machine vision is improving patient care by detecting when a patient moves in bed or is getting up, alerting staff to prevent falls.\n*   Some healthcare organizations are experimenting with retrieval-augmented generation (RAG), an AI framework that combines vector database capabilities with LLMs to provide more accurate and recent data to chatbots.\n\n**Market Trends and Adoption:**\n*   The global AI in healthcare market, valued at approximately USD 26.6 billion in 2024, is projected to grow to nearly USD 187 billion by 2030 at a Compound Annual Growth Rate (CAGR) of about 38.5%. This growth is driven by the rising chronic disease burden and the explosion of healthcare data.\n*   Key adoption areas for AI in healthcare include diagnostics, imaging, genomics, and personalized medicine.\n*   Increased use of AI for operational efficiency and workflow automation is also a driving factor.\n*   Salt AI secured $10 million in funding to scale its contextual AI platform for life sciences and healthcare, aimed at accelerating AI adoption through visual, compliant, and user-friendly workflows.\n*   Healthcare is leading enterprise AI adoption, deploying AI at more than twice the rate (2.2x) of the broader economy.\n*   In just two years, healthcare went from 3% AI adoption to becoming a major AI adopter, with health systems leading at 27% adoption, followed by outpatient facilities (18%) and payers (14%).\n*   According to Menlo Ventures'' research, 22% of healthcare organizations implemented domain-specific AI tools, a 7x increase over 2024 and 10x over 2023.\n*   Healthcare AI spending hit $1.4 billion in 2025, nearly tripling 2024''s investment.\n*   In 2025, healthcare organizations are expected to have more risk tolerance for AI initiatives, leading to increased adoption.\n*   AI-enhanced virtual care is becoming more sophisticated, allowing for precise diagnostics and predictive healthcare management.\n*   Remote patient monitoring is advancing with technologies like the Momentum Health app for continuous monitoring of conditions such as scoliosis and wearable devices like GTcardio for real-time data on heart rate, respiratory functions, and sleep patterns.\n*   Personalized care is leveraging patient history and preferences, with platforms like Careloop Health utilizing AI to detect and predict mental health issues.\n*   Digital therapeutics are enabling remote care for conditions like Alzheimer''s.\n*   Healthcare analytics is being used to provide personalized care plans.\n*   Telerobotics with advanced robotics technologies allows remote control over surgical procedures.\n\n**Challenges and Considerations:**\n*   Challenges remain around data bias, transparency, safety, and cybersecurity risks in AI in healthcare.\n*   The World Economic Forum highlights that while AI technologies are rapidly developing, healthcare is \"below average\" in its adoption of AI compared to other industries.\n*   A health worker shortage of 11 million is expected by 2030, and AI has the potential to help bridge that gap.\n*   Experts caution against \"cyberchondria\" where people turn to AI for medical diagnoses, emphasizing that AI should complement human intelligence.\n*   The industry is grappling with strict data privacy laws related to AI implementation.\n\n**Policy and Education:**\n*   The AMA adopted a policy to advance AI literacy in medical education (Nov 18, 2025).\n*   The AMA will work to provide medical students and physicians with the necessary health AI training (Nov 19, 2025)."}}}, {"function_response": {"id": "adk-00bf58af-14cf-446b-bf97-d147e322c29a", "name": "ResearchAgent", "response": {"result": "Here are key developments in drug discovery:\n\n*   Biotechnology, digital innovation, and advanced engineering are changing how researchers find, design, and test new treatments.\n*   Computer models can simulate intricate biological processes, forecast compound behavior with target proteins, and design novel proteins for medical applications.\n*   Tools like DeepVariant and AlphaFold help scientists understand protein folding, which is crucial for treatments for diseases such as Alzheimer''s, cancer, and genetic disorders.\n*   Virtual \"in silico\" trials can predict human body reactions to new drugs before testing, reducing early-stage animal or human testing and accelerating the path to clinical trials.\n*   Microfluidic technology is transforming how scientists conduct trials on potential medicines.\n*   3D bioprinting produces living tissues and organ-like structures (organoids) that respond analogously to real organs, serving as key tools for testing new drugs safely.\n*   Patient-specific cells can be used with bioprinted models to tailor testing to a patient''s genetic makeup, a step towards personalized medicine.\n*   CRISPR, mRNA, and digital modeling allow for more efficient treatment design and testing.\n*   The integration of AI, nanotechnology, organoids, and organ-on-a-chip systems is advancing drug discovery by improving precision and data-driven decision-making, and enabling targeted drug delivery.\n*   Organoids and organ-on-a-chip technologies are reshaping drug discovery by providing models that better mimic human biology, offering a more accurate representation of drug behavior in the human body.\n*   Nanotechnology is used in drug discovery and delivery to address challenges like drug solubility, stability, and bioavailability through nanoparticle encapsulation.\n*   AI played a critical role during the COVID-19 pandemic by accelerating the discovery of potential treatments.\n*   AI has revolutionized drug repurposing by identifying new therapeutic uses for existing drugs and is crucial in developing personalized medicine by analyzing genetic and molecular data.\n*   By 2034, the global AI pharmaceutical market might reach about $16.5 billion.\n*   About 30% of new drugs are expected to be found using AI by 2025.\n*   AI is merging with quantum computing and synthetic biology, potentially making drug discovery faster and more personalized.\n*   AI tools like machine learning, deep learning, and natural language processing find patterns in complex clinical and molecular data.\n*   By 2025, AI is expected to help the U.S. drug sector generate between $350 billion and $410 billion annually through its use in drug discovery, clinical trials, and manufacturing.\n*   The number of AI drug discovery projects grew from 10 in 2015 to over 100 in 2021.\n*   Recent discoveries include using garlic-derived nanovesicles to deliver antibiotics against Staphylococcus infections, a synthetic form of THC to reverse nerve cell toxicity, and a new molecule that quickly neutralizes the blood-thinning drug heparin.\n*   A new, open-source web-based modeling tool, a \"virtual liver,\" is designed to predict a potential drug candidate''s absorption, distribution, metabolism, and excretion rates early in the discovery process.\n*   Trends in drug discovery include driving E3 ligase discovery through PROTAC momentum, expanding probiotic use for systemic diseases, delivering precision oncology through radiopharmaceutical conjugates, and scaling CAR-T therapy for solid tumors.\n*   Other trends include enabling early diagnosis of neurodegenerative diseases with biomarkers, transforming drug development with AI-powered trial simulations, launching rapid-response gene editing with personalized CRISPR therapy, and accelerating antiviral discovery with AI.\n*   Researchers at MIT reported the invention of antibiotics using generative AI against drug-resistant strains of gonorrhea and Staphylococcus aureus in August 2025.\n*   Researchers are harnessing gut bacteria to treat antibiotic-resistant infections, metabolic disorders, and mental health conditions, with over 180 microbiome-targeted therapies in development as of 2025.\n*   The future of drug development holds immense promise, utilizing biotechnology and artificial intelligence.\n*   AI algorithms analyze large datasets to identify patterns and predict the efficacy and safety of potential drug candidates, accelerating discovery and minimizing human error.\n*   AI-powered platforms enhance clinical trial efficiency by identifying patient subpopulations that would benefit most from a therapy.\n*   The shift towards personalized medicine leverages AI and big data to design medicines tailored to individual patients using genetic, molecular, and lifestyle data.\n*   AlphaFold, an AI-based tool, predicts protein structures with high accuracy, which are common targets for drug development.\n*   Six companies are leading the race to deliver AI-designed medicines that are undergoing clinical trial evaluation, though no AI-designed drug has completed the entire regulatory approval process yet.\n*   More than 250 companies are working in the AI-driven drug discovery industry, with over half based in the United States.\n*   Isomorphic Labs, launched in 2021, builds on the AlphaFold system to advance human health by developing predictive and generative AI models.\n*   The global AI drug discovery market, valued around $1 to $1.7 billion in 2023, is projected to be worth $9 billion or more by the decade''s end.\n*   In 2024, David Baker, Demis Hassabis, and John Jumper won the Nobel Prize in Chemistry for computational protein design and structure prediction.\n*   There have been over 500 FDA submissions with AI components from 2016 to 2023.\n*   Clinical Trial AI leads publication volume, representing 72% of projected 2024 papers, followed by AI protein structure at 17% and AI drug discovery at 11%.\n*   AI-designed drugs show 80-90% success rates in Phase I trials compared to 40-65% for traditional drugs.\n*   Development timelines can be reduced from over 10 years to potentially 3-6 years, with costs cut by up to 70% through better compound selection using AI.\n*   Over $5.2 billion was invested in AI drug discovery by 2021.\n*   The first AI-designed molecule entered human clinical trials in 2020, and the FDA granted its first Orphan Drug Designation to an AI-discovered treatment in 2023.\n*   The pharmaceutical industry is focusing more on targeted strategies for rare diseases and personalized medicine.\n*   AI-powered platforms can design drug candidates from scratch, identify repurposing opportunities, and reduce trial-and-error in compound testing.\n*   Insilico Medicine''s AI-generated anti-fibrotic drug entered Phase 2 trials in record time.\n*   The future of drug discovery in 2025 includes ecosystems of smart diagnostics, wearable tech, and companion apps.\n*   Top drug development trends in 2025 include AI & Data Analytics, Patient-centric Trials, Assay Development, Advanced Manufacturing, Synthetic Biology, Virtual Trials, High-performance Computing, 3D Cell Culture, and Cybersecurity.\n*   Advances in synthetic biology provide accurate models to screen drug targets and allow researchers to understand complex interactions between genes and proteins.\n*   Startups are creating biological devices to observe cellular responses to new drugs without human testing and synthesizing large protein libraries in parallel.\n*   By 2024, AI has cut the time to bring a new drug to market from approximately 10 years to 4 years.\n*   CRISPR gene editing has moved from lab theory to real treatments.\n*   Blockchain technology is reshaping pharma supply chains by offering transparency, with the global blockchain technology in healthcare market projected to grow at a CAGR of 63.3% from 2024 to 2030.\n*   Digital twins are being employed in trial simulations to create virtual models of physical objects or systems.\n*   Gene therapy offers transformative potential for many conditions with few or no effective treatments, especially for rare diseases.\n*   The FDA has shown a willingness to use accelerated approval pathways for gene therapies in diseases like Huntington''s and Fabry disease.\n*   Drugs targeting multiple pathways within a single therapy, such as bispecific antibodies, are showing potential in addressing complex diseases, particularly rare diseases.\n*   Drugs aiming to reduce the expression of endogenous proteins that misfold and accumulate in the brain, such as antisense oligonucleotide-based drugs, are under development for neurodegenerative diseases."}}}], "role": "user"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
INSERT INTO events VALUES('c7a6a8e0-bdcf-4d3d-9d8e-0cf344dbfe2f','ottawa_public_health_agent','user','compaction_demo','e-b485c65a-f588-458b-ac4e-4dbccfe3dcf4','ottawa_public_health_agent',X'',NULL,NULL,'2025-11-30 02:06:36.754405','{"parts": [{"text": "Here''s a summary of the latest news in AI in healthcare and new developments in drug discovery:\n\n**Latest News about AI in Healthcare:**\n\n*   **Google''s Next-Gen AI Tools (Google I/O 2025):** Google showcased advanced AI models for imaging interpretation, clinical documentation, and medical copilots to assist physicians in real-time. This includes Gemini-based models for radiology and workflow automation, aiming to streamline decision-making and integrate with Electronic Health Records (EHRs).\n*   **Reproductive Health Chatbot:** Researchers at the University of North Carolina launched an AI-powered chatbot to provide confidential and accurate information on reproductive health topics.\n*   **AI in Drug Discovery and R&D:** Pharmaceutical Global Capability Centers (GCCs) in India are heavily utilizing AI to accelerate drug discovery, reduce R&D costs, and analyze vast amounts of genomic, proteomic, and clinical data.\n*   **New AI Agents and Tools:** NextGen Healthcare launched its NextGen Navigator AI Agent, and Microsoft introduced its Dragon Copilot for clinical consultation notes. Google also offers a suite of AI models for administrative tasks.\n*   **Enhanced Patient Care and Diagnostics:** AI is being used in various clinical settings, including Valley Children''s Hospital for pediatric care, rapid skin cancer diagnosis in Melbourne, and AIIMS Patna for enhanced patient care. New AI tests identify prostate cancer patients who benefit from specific treatments, and AI-powered hearing aids are improving connectivity for individuals with hearing impairments.\n*   **Early Disease Detection:** AstraZeneca developed an AI machine learning model that can detect early signs of over 1,000 diseases, predicting diagnoses years in advance. A new AI software is also more accurate than professionals in examining stroke patient brain scans.\n*   **Operational Efficiency:** Digital patient platform Huma significantly reduced hospital readmission rates and time spent reviewing patients. AI is also helping detect sepsis faster at the Cleveland Clinic and providing 3D views of patient spines during surgery at Duke Health.\n*   **Investment and Market Growth:** The global AI in healthcare market is projected to grow substantially, from approximately USD 26.6 billion in 2024 to nearly USD 187 billion by 2030, driven by the increasing burden of chronic diseases and the explosion of healthcare data. Healthcare is leading enterprise AI adoption at more than twice the rate of other industries.\n*   **Challenges:** Despite rapid advancements, challenges remain concerning data bias, transparency, safety, and cybersecurity risks. There''s also a projected health worker shortage, which AI could help address.\n\n**New Developments in Drug Discovery:**\n\n*   **Technological Integration:** Biotechnology, digital innovation, and advanced engineering are transforming drug discovery. Computer models simulate biological processes and design novel proteins.\n*   **AI and Machine Learning:** AI and ML are central to accelerating drug discovery, reducing R&D costs, and improving efficiency. Tools like DeepVariant and AlphaFold aid in understanding protein folding, crucial for treating various diseases. AI-powered virtual \"in silico\" trials predict drug reactions before human testing, and AI helps in drug repurposing and personalized medicine by analyzing genetic data.\n*   **Advanced Testing Models:** Microfluidic technology, 3D bioprinting (creating organoids), and organ-on-a-chip systems provide more accurate models that mimic human biology, allowing for safer and more effective drug testing. Patient-specific cells can also be used for personalized testing.\n*   **CRISPR and mRNA:** These technologies, along with digital modeling, allow for more efficient treatment design and testing, including rapid-response gene editing and mRNA vaccines.\n*   **Nanotechnology:** Used to improve drug solubility, stability, and bioavailability through nanoparticle encapsulation for better drug delivery.\n*   **Market Growth and Investment:** The global AI pharmaceutical market is expected to reach about $16.5 billion by 2034, with approximately 30% of new drugs expected to be found using AI by 2025. Significant investments are being made in AI-driven drug discovery companies.\n*   **Clinical Success and Efficiency:** AI-designed drugs are showing higher success rates in Phase I trials compared to traditional drugs, and development timelines can be significantly reduced, along with cost cuts. The first AI-designed molecule entered human clinical trials in 2020.\n*   **Personalized Medicine:** The shift towards personalized medicine is leveraging AI and big data to design treatments tailored to individual patients based on their genetic, molecular, and lifestyle data.\n*   **Novel Discoveries:** Recent discoveries include using garlic-derived nanovesicles for antibiotic delivery, a synthetic form of THC to reverse nerve cell toxicity, and a new molecule to neutralize heparin.\n*   **Emerging Trends:** These include driving E3 ligase discovery through PROTAC momentum, expanding probiotic use for systemic diseases, delivering precision oncology through radiopharmaceutical conjugates, and scaling CAR-T therapy for solid tumors. Other trends involve early diagnosis of neurodegenerative diseases with biomarkers and accelerating antiviral discovery with AI.\n*   **Nobel Prize Recognition:** In 2024, David Baker, Demis Hassabis, and John Jumper won the Nobel Prize in Chemistry for computational protein design and structure prediction, highlighting the importance of AI in this field.\n*   **Future Outlook:** The future of drug development holds immense promise with the continued integration of biotechnology and AI, leading to ecosystems of smart diagnostics, wearable tech, and companion apps."}], "role": "model"}',NULL,NULL,'{"cache_tokens_details": [{"modality": "TEXT", "token_count": 1891}], "cached_content_token_count": 1891, "candidates_token_count": 1134, "prompt_token_count": 5987, "prompt_tokens_details": [{"modality": "TEXT", "token_count": 5987}], "total_token_count": 7121}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
